import React, { useState, useEffect } from 'react';
import Navbar from '../Components/nav-admin';

function UserTable() {
    const [users, setUsers] = useState([
        { id: 1, name: "Alice Johnson", email: "alice@example.com", role: "Admin" },
        { id: 2, name: "Bob Smith", email: "bob@example.com", role: "User" },
        { id: 3, name: "Charlie Daniels", email: "charlie@example.com", role: "Technician" },
        { id: 3, name: "Charlie Daniels", email: "charlie@example.com", role: "Technician" }

    ]);

    const [statistics, setStatistics] = useState({
        totalUsers: 3,
        totalDoctors: 1,
        totalTechnicians: 1,
        totalConsultations: 5,
        totalOrders: 2,
        totalPayments: "$200"
    });

    const handleDelete = (id) => {
        setUsers(users.filter(user => user.id !== id));
        setStatistics(prevStats => ({ ...prevStats, totalUsers: prevStats.totalUsers - 1 }));
    };

    return (
        <div className="user-management-container">
            <Navbar/>
            <div className="stats-container">
                <div className="stat-card">Total Users: {statistics.totalUsers}</div>
                <div className="stat-card">Doctors: {statistics.totalDoctors}</div>
                <div className="stat-card">Technicians: {statistics.totalTechnicians}</div>
                <div className="stat-card">Consultations: {statistics.totalConsultations}</div>
                <div className="stat-card">Orders: {statistics.totalOrders}</div>
                <div className="stat-card">Payments: {statistics.totalPayments}</div>
            </div>
            <div className="user-table-container">
                <table className="user-table">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Role</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {users.map((user, index) => (
                            <tr key={index}>
                                <td>{user.name}</td>
                                <td>{user.email}</td>
                                <td>{user.role}</td>
                                <td>
                                    <button onClick={() => alert("Edit functionality not implemented.")}>Edit</button>
                                    <button onClick={() => handleDelete(user.id)}>Delete</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default UserTable;
